import React, { Component } from 'react'

class Features extends Component {
    render() {
        return (

            <section className="pt-7">
                <div className="container">
                    <div className="row pb-7 border-bottom">
                        <div className="col-12 col-md-6 col-lg-3">

                            {/* <!-- Item --> */}
                            <div className="d-flex mb-6 mb-lg-0">

                                {/* <!-- Icon --> */}
                                <i className="fe fe-truck font-size-lg text-primary"></i>

                                {/* <!-- Body --> */}
                                <div className="ml-6">

                                    {/* <!-- Heading --> */}
                                    <h6 className="heading-xxs mb-1">
                                        Free shipping
              </h6>

                                    {/* <!-- Text --> */}
                                    <p className="mb-0 font-size-sm text-muted">
                                        From all orders over $100
              </p>

                                </div>

                            </div>

                        </div>
                        <div className="col-12 col-md-6 col-lg-3">

                            {/* <!-- Item --> */}
                            <div className="d-flex mb-6 mb-lg-0">

                                {/* <!-- Icon --> */}
                                <i className="fe fe-repeat font-size-lg text-primary"></i>

                                {/* <!-- Body --> */}
                                <div className="ml-6">

                                    {/* <!-- Heading --> */}
                                    <h6 className="mb-1 heading-xxs">
                                        Free returns
              </h6>

                                    {/* <!-- Text --> */}
                                    <p className="mb-0 font-size-sm text-muted">
                                        Return money within 30 days
              </p>

                                </div>

                            </div>

                        </div>
                        <div className="col-12 col-md-6 col-lg-3">

                            {/* <!-- Item --> */}
                            <div className="d-flex mb-6 mb-md-0">

                                {/* <!-- Icon --> */}
                                <i className="fe fe-lock font-size-lg text-primary"></i>

                                {/* <!-- Body --> */}
                                <div className="ml-6">

                                    {/* <!-- Heading --> */}
                                    <h6 className="mb-1 heading-xxs">
                                        Secure shopping
              </h6>

                                    {/* <!-- Text --> */}
                                    <p className="mb-0 font-size-sm text-muted">
                                        You're in safe hands
              </p>

                                </div>

                            </div>

                        </div>
                        <div className="col-12 col-md-6 col-lg-3">

                            {/* <!-- Item --> */}
                            <div className="d-flex">

                                {/* <!-- Icon --> */}
                                <i className="fe fe-tag font-size-lg text-primary"></i>

                                {/* <!-- Body --> */}
                                <div className="ml-6">

                                    {/* <!-- Heading --> */}
                                    <h6 className="mb-1 heading-xxs">
                                        Over 10,000 Styles
              </h6>

                                    {/* <!-- Text --> */}
                                    <p className="mb-0 font-size-sm text-muted">
                                        We have everything you need
              </p>

                                </div>

                            </div>

                        </div>
                    </div>
                </div>
            </section>
        )
    }
}

export default Features
